/**
 * 忽略指定对象的某些属性得到一个新对象
 * @param obj，原对象
 * @param rawPredict，判断函数，接收value和key，分别是obj的值和value，该函数应该返回一个bool
 *        如果传入非函数值，nullish将等效为()=>true，其余等效为()=>false
 * @return 一个基于原对象obj生成的新对象，它忽略了obj中所有predict执行为真的属性
 */
declare function omitBy(obj?: Object | any[], rawPredict?: Function): Object | any[];
export default omitBy;
